import React from 'react';
import { BrowserRouter, Routes, Route as MyRoute } from 'react-router-dom';
import Header from './components/Header';
// import MainPage from './components/MainPage'; // Your "Find a Pet" component
// import Home from './components/Home'; // Your Home component
// import About from './components/About'; // Your About component

// Define a simple "Hello, World!" component for the About page
const About = () => {
  return (
    <div>
      <h2>Hello, World!</h2>
      <p>This is the About page.</p>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      {/* The Header component is rendered at the top */}
      <Header />

      {/* Routes are defined using the <Routes> component */}
      <Routes>
        {/* Define your routes using <Route> or <MyRoute> */}
        {/* <MyRoute path="/" element={<Home />} /> Home route */}
        <MyRoute path="/about" element={<About />} /> {/* About route */}
        {/* <MyRoute path="/find-a-pet" element={<MainPage />} /> Find a Pet route */}
      </Routes>
    </BrowserRouter>
  );
};

export default App;
